(8, 'HYB Opening Ceremony', 'Please click on the title link above to know more about HYB Opening Ceremony information.', 'Did someone mention about the opening ceremony?\r\nHYB Opening Ceremony aims to introduce you to our tutors, our ideas and our focus.\r\nGrab your chance to meet your classmates too.\r\n\r\nDate: 25 September 2019\r\nVenue: Dewan Banquet\r\nTime: 7.30 p.m.\r\n\r\nKindly remind that you need to bring along with your receipt and slip to get your brand new textbook.\r\n\r\nSee you.\r\n\r\nFacebook : https://www.facebook.com/hybutm/\r\nInstagram : https://www.instagram.com/hybutm/\r\n#hybutm', , 'HybUTM', '2019-10-20 10:01:28');
INSERT INTO `info_news` (`news_id`, `news_title`, `news_short_description`, `news_full_content`, `news_image`, `news_author`, `news_published_on`) VALUES
(11, '[Easy Learn Mandarin]', '(xng) (s) (z) means words that look similar but with different meanings. The words we will be introducing today have subtle differences on the left side of the Chinese character.', '(xng) (s) (z) means words that look similar but with different meanings. The words we will be introducing today have subtle differences on the left side of the Chinese character. Although the difference is minor, it brings a big change on the word\'s meaning! We had learnt some(xng) (s) (z) in LearnMandarinHYB032, so, let us learn some of these new special words this week!\r\n\r\n032, \r\n\r\n#hybutm\r\n#034\r\n#LearnMandarinHYB034', , 'HybUTM', '2019-10-20 11:37:17');
